15th century, middle. Origin and early provanance unknown, but the breviary was intended for a church within the diocece of Uppsala ( Helander
). According to Moberg, the manuscript belongs to a group of breviaries which includes A 50 and A 100 of the National Library, and C 507 and W 63 of Uppsala University Library ( Moberg
). On , , and (presumably) (partly trimmed), an early modern hand has made marginal notations comparing the contents of the breviary to the printed edition of 1496 .
